import useEffect from 'react';

const get = (url, responseData) => {
  useEffect(() => {
    fetch(url, {
      method: 'get',
      dataType: 'json',
      headers: { 'Content-Type': 'application/json' },
    })
      .then((result) => result.json())
      .then((result) => result.results)
      .then((result) => {
        setResponseData(result);
        return responseData;
      });
  }, [url]);
};

export default get;
